import React, { useState } from 'react';
import { Link, useLocation } from 'react-router-dom';
import { useCart } from '../context/CartContext';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const { getCartCount } = useCart();
  const location = useLocation();

  const isActive = (path) => {
    return location.pathname === path;
  };

  return (
    <nav className="bg-beige shadow-lg sticky top-0 z-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center h-16">
          {/* Logo */}
          <Link to="/" className="flex items-center space-x-2">
            <span className="text-2xl">‚òïÔ∏è</span>
            <span className="font-playfair text-2xl font-bold text-dark-brown">
              EstateDeli
            </span>
          </Link>

          {/* Desktop Navigation */}
          <div className="hidden md:flex items-center space-x-8">
            <Link 
              to="/" 
              className={`navbar-link ${isActive('/') ? 'text-coffee border-b-2 border-coffee' : ''}`}
            >
              Home
            </Link>
            <Link 
              to="/menu" 
              className={`navbar-link ${isActive('/menu') ? 'text-coffee border-b-2 border-coffee' : ''}`}
            >
              Menu
            </Link>
            <Link 
              to="/shop" 
              className={`navbar-link ${isActive('/shop') ? 'text-coffee border-b-2 border-coffee' : ''}`}
            >
              Shop
            </Link>
            <Link 
              to="/contact" 
              className={`navbar-link ${isActive('/contact') ? 'text-coffee border-b-2 border-coffee' : ''}`}
            >
              Contact
            </Link>
          </div>

          {/* Right side - Cart and Login */}
          <div className="flex items-center space-x-4">
            {/* Cart Icon */}
            <button className="relative p-2 text-dark-brown hover:text-coffee transition-colors">
              <span className="text-xl">üõí</span>
              {getCartCount() > 0 && (
                <span className="absolute -top-1 -right-1 bg-coffee text-white text-xs rounded-full h-5 w-5 flex items-center justify-center">
                  {getCartCount()}
                </span>
              )}
            </button>

            {/* Login Button */}
            <button className="btn-secondary text-sm px-4 py-2">
              Login
            </button>

            {/* Mobile menu button */}
            <button 
              className="md:hidden p-2"
              onClick={() => setIsOpen(!isOpen)}
            >
              <div className="w-6 h-6 flex flex-col justify-center items-center">
                <span className={`bg-dark-brown block transition-all duration-300 ease-out h-0.5 w-6 rounded-sm ${isOpen ? 'rotate-45 translate-y-1' : '-translate-y-0.5'}`}></span>
                <span className={`bg-dark-brown block transition-all duration-300 ease-out h-0.5 w-6 rounded-sm my-0.5 ${isOpen ? 'opacity-0' : 'opacity-100'}`}></span>
                <span className={`bg-dark-brown block transition-all duration-300 ease-out h-0.5 w-6 rounded-sm ${isOpen ? '-rotate-45 -translate-y-1' : 'translate-y-0.5'}`}></span>
              </div>
            </button>
          </div>
        </div>

        {/* Mobile Navigation */}
        <div className={`md:hidden ${isOpen ? 'block' : 'hidden'}`}>
          <div className="px-2 pt-2 pb-3 space-y-1 sm:px-3 bg-beige">
            <Link 
              to="/" 
              className={`navbar-link block px-3 py-2 rounded-md text-base font-medium ${isActive('/') ? 'text-coffee bg-cream' : ''}`}
              onClick={() => setIsOpen(false)}
            >
              Home
            </Link>
            <Link 
              to="/menu" 
              className={`navbar-link block px-3 py-2 rounded-md text-base font-medium ${isActive('/menu') ? 'text-coffee bg-cream' : ''}`}
              onClick={() => setIsOpen(false)}
            >
              Menu
            </Link>
            <Link 
              to="/shop" 
              className={`navbar-link block px-3 py-2 rounded-md text-base font-medium ${isActive('/shop') ? 'text-coffee bg-cream' : ''}`}
              onClick={() => setIsOpen(false)}
            >
              Shop
            </Link>
            <Link 
              to="/contact" 
              className={`navbar-link block px-3 py-2 rounded-md text-base font-medium ${isActive('/contact') ? 'text-coffee bg-cream' : ''}`}
              onClick={() => setIsOpen(false)}
            >
              Contact
            </Link>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
